import React from 'react'
import { Text } from 'react-native'
import { Button, TextInput, View } from 'react-native-web'

const NoteEdit = () => {
  return (
    <View
      style={{
        flex: 1,
        alignItems: "center",
        backgroundColor: "#FFEAB5",
      }}
    >
      <Touchabl
        title="Back"
        style={{
          borderWidth: 1,
          padding: 25,
          borderColor: "black",
          backgroundColor: "#C4D7ED",
          borderRadius: 15,
          bottom: 0,
          left: 0,
          width: 100,
          height: 100,
          position: "absolute",
        }}
      />
      <TextInput
        multiline={true}
        numberOfLines={4}
        style={{
          height: "100%",
          backgroundColor: "white",
          width: "90%",
          marginTop: 20,
          marginBottom: 10,
          borderRadius: 10,
        }}
      ></TextInput>
    </View>
  );
}

export default NoteEdit
